description:
Ralph requests an advance in his paycheck to be able to surprise his girlfriend for her birthday with flowers, wine and an expensive meal. Rhylee tells him that as sweet as his surprise is, that's not exactly what a girl really wants. Curious about this remark, Ralph asks her for more information about how to surprise his girlfriend. Rhylee shows him more than he expected...



